import { makeStyles, TextField } from '@material-ui/core';
import React from 'react';

const Register = () => {
  const { container, title, form } = useStyles();

  return (
    <div className={container}>
      <div className={title}>Cadastro</div>
      <div className={form}>
        <TextField id="text-field-name" variant="outlined" label="Nome" />
        <TextField id="text-field-cpf" variant="outlined" label="CPF" />
        <TextField id="text-field-email" variant="outlined" label="E-mail" />
        <TextField id="text-field-telephone" variant="outlined" label="Telefone" />
      </div>
    </div>
  );
};

const useStyles = makeStyles({
  container: {
    padding: 32,
  },
  title: {
    fontSize: 32,
    textAlign: 'left',
    marginBottom: 24,
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
  }
})

export default Register;
